    function handleChange(event) { // Handles changes from events invoked by ElementaryAlgebraAccordion
        const {name, value, type, checked} = event.target
        setPdfData(prevPDFData => {
            const updatedData = {
                ...prevPDFData,
                [name]: type === "checkbox" ? checked : value
            }
            generatePDF(updatedData)
            return updatedData
        })
    }
    function changeAllToTopicDefault(defaultTopicObject){
        setPdfData(defaultTopicObject)
        generatePDF(defaultTopicObject)
    }

    function downloadPdf(){
        pdfDocument.save();
    }

